import React, { useState } from "react";
import { Button, Form } from "react-bootstrap";

const AddCompetitorForm = ({ addCompetitorToHeat }) => {
  const [competitorName, setCompetitorName] = useState("");
  const [category, setCategory] = useState("");
  const [subCategory, setSubCategory] = useState("");
  const [boardType, setBoardType] = useState("");
  const [gender, setGender] = useState("");
  const [ageCategory, setAgeCategory] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    addCompetitorToHeat({
      name: competitorName,
      category,
      sub_category: subCategory,
      board_type: boardType,
      gender,
      age_category: ageCategory,
    });
    setCompetitorName("");
    setCategory("");
    setSubCategory("");
    setBoardType("");
    setGender("");
    setAgeCategory("");
  };

  return (
    <Form onSubmit={handleSubmit}>
      <h4>Add Competitor to Heat</h4>
      <Form.Group controlId="competitorName">
        <Form.Label>Competitor Name</Form.Label>
        <Form.Control
          type="text"
          value={competitorName}
          onChange={(e) => setCompetitorName(e.target.value)}
          required
        />
      </Form.Group>
      <Form.Group controlId="category" className="mt-2">
        <Form.Label>Category</Form.Label>
        <Form.Control
          type="text"
          value={category}
          onChange={(e) => setCategory(e.target.value)}
          required
        />
      </Form.Group>
      <Form.Group controlId="subCategory" className="mt-2">
        <Form.Label>Sub Category</Form.Label>
        <Form.Control
          type="text"
          value={subCategory}
          onChange={(e) => setSubCategory(e.target.value)}
          required
        />
      </Form.Group>
      <Form.Group controlId="boardType" className="mt-2">
        <Form.Label>Board Type</Form.Label>
        <Form.Control
          type="text"
          value={boardType}
          onChange={(e) => setBoardType(e.target.value)}
          required
        />
      </Form.Group>
      <Form.Group controlId="gender" className="mt-2">
        <Form.Label>Gender</Form.Label>
        <Form.Control
          type="text"
          value={gender}
          onChange={(e) => setGender(e.target.value)}
          required
        />
      </Form.Group>
      <Form.Group controlId="ageCategory" className="mt-2">
        <Form.Label>Age Category</Form.Label>
        <Form.Control
          type="text"
          value={ageCategory}
          onChange={(e) => setAgeCategory(e.target.value)}
          required
        />
      </Form.Group>
      <Button variant="primary" type="submit" className="mt-3">
        Add Competitor
      </Button>
    </Form>
  );
};

export default AddCompetitorForm;
